import styled from "styled-components";

export const inputBox = styled.div`
  display: flex;
  flex-direction: row;
`;

export const input = styled.input`
border: 1px solid #D9D9D9;
border-radius: 4px;
box-sizing: border-box;
width: 150 px;
height: 54px
`
